import React, { useState } from 'react'
import axios from 'axios'
import { Link } from 'react-router-dom'
import '../style/Login.css'

const Login = () => {

  const [inputs, setInputs] = useState({})

  const { username, password } = inputs

  const userLogin = e => {
    e.preventDefault()

    axios({
      url: `http://localhost:8080/users/signin`,
      method: 'post',
      headers: { 'Content-Type': 'application/json', 'Authorization': 'JWT fefege..' },
      data: {
        username,
        password
      }
    })
      .then(res => {
        console.log(`res: ${JSON.stringify(res)}`)
        setInputs(res.data)

        alert('로그인 성공 !')
      })
      .catch(err => {
        console.log(`${err}`)

        alert('아이디와 비밀번호를 확인하세요.')
      })
  }

  const inputChange = e => {
    const { name, value } = e.target
    console.log(inputs)

    setInputs({
      ...inputs,
      [name]: value
    })
  }

  return (
    <>
      <h1>로그인</h1>

      <div id="wrap">
        <div id="header">
          <h1><a href="https://www.naver.com" class="sp h_logo" id="log.naver"><span class="blind">NAVER</span></a></h1>
          <div class="lang">
            <select id="locale_switch" name="locale_switch" title="언어선택" class="sel">
              <option value="ko_KR">한국어</option>
              <option value="en_US">English</option>
              <option value="zh-Hans_CN">中文(简体)</option>
              <option value="zh-Hant_TW">中文(台灣)</option>
            </select>
          </div>
        </div>
      </div>
    </>
  )
}

export default Login
